function SearchBar ({enSubmit}){

        function handleClic(){
            enSubmit ("Gatitos");
        }

    return (

        <div>
            <input type="text" />
            <button onClick={handleClic}>Clic</button>
        </div>
    )
}

export default SearchBar;
